import React from 'react';
import LazyHero from 'react-lazy-hero';

import './Home.css';
import Picture from'./Pics/Apfelernte.jpg';

export default class Support extends React.Component {

	componentWillUnmount(){
    window.scrollTo(0, 0)
  }

	render(){
		return(
  		<div>
				<LazyHero color = "#000000" parallaxOffset="100" minHeight='100vh' opacity ="0.5" imageSrc={Picture}/>

				<div className="H1-Titel">
					<h1> Natürliche und unweltschonende Herstellung </h1><br/>
          <h2> sind nur zwei von vielen guten Gründen, den Weppes zu probieren!</h2>
				</div>

  		</div>
		);
	}
}
